import React from 'react';

export default function Speakers(){
    const speakers = [
        {
            imgSrc: 'speaker-component-1124.png',
            name: 'Douglas'
        },
        {
            imgSrc: 'speaker-component-1530.png',
            name: 'Tamara'
        },
        {
            imgSrc: 'speaker-component-10803.png',
            name: 'Eugene'
        }
    ];
    return (
        <div>
            {
                speakers.map((speakers) => {
                    <img src="images/speaker-component-1124.png" alt=""/>
                })
            }

            <img src="images/speaker-component-1530.png" alt=""/>
            <img src="images/speaker-component-10803.png" alt=""/>
        </div>
    );
}
